function setNavigation(a) {
	if (level = a.bodyClass) {
		$("body").addClass(level)
	}
	if (id = a.navigationLinkID) {
		$("#" + id).find("a").addClass("current")
	}
	if (id = a.subnavigationLinkID) {
		$("#" + id).addClass("active");
		
		$('#' + id + ' > a').click(function(e) {
			
			e.preventDefault();
			if( id = a.tertiaryLinkID)
			{
				if( subNavId = a.subnavigationLinkID)
				{
					// If the tertiary link id is displayed, then we need to
					// give the toggle ability
					$('.' + 'tertiary-links', $('#' + subNavId)).slideToggle();
				}
				
			}
			
			
		});
	}
	
	
	if (id = a.secondSubnavigationLinkID) {
		
		
		$('#' + id + ' > a').click(function(e) {
			
			e.preventDefault();
			if( id = a.tertiaryLinkID)
			{
				if( subNavId = a.secondSubnavigationLinkID)
				{
					// If the tertiary link id is displayed, then we need to
					// give the toggle ability
					$('.' + 'tertiary-links', $('#' + subNavId)).slideToggle();
				}
				
			}
			
			
		});
	}
	if (id = a.tertiaryLinkID) {
		if (subNavId = a.subnavigationLinkID) {
			$("#" + subNavId).removeClass("active");
			$("#" + subNavId).addClass("display-ter-nav active-sub")
		}
		$("#" + id).addClass("active-ter");
		$(".tertiary-links", $("#" + subNavId)).show()
	}
}

