function submitForm(d) {
	
	var e = document.forms.theForm;
	var c = document.getElementsByTagName("input");
	var a;
	var b = c.length;
	for (a = 0; a < b; a++) {
		if (c[a].type == "button") {
			c[a].disabled = true
		}
	}
	if (d) {
		e.action = d
	}
	// verify date range
	// until date cannot be before effdate
	if($('#effdate').val() != '' ){ 
		if(new Date($('#effdate').val()) > new Date($('#untildate').val())) {
			alert("The until date must be after the effective date.");
			for (a = 0; a < b; a++) {
				if (c[a].type == "button") {
					c[a].disabled = false
				}
			}
			
			 $('body').animate({scrollTop:$('#untildate').offset().top - 30}, 200);
			return false;
		} 
	}

	
	e.submit()
};

